import { createMuiTheme } from '@material-ui/core/styles';
import red from '@material-ui/core/colors/red';


const muiTheme = createMuiTheme({
    palette: {
        primary: { 
            main: '#36c136',
            contrastText: '#fff', 
        }, 
        secondary: { main: '#4286f4' }
    }
});

const dangerTheme = createMuiTheme({
    palette: {
        main: red
    }
})

export default muiTheme
